// Create a pdf with the games in the game table
function createPDF() {
    var bodytextcolor = '#0f0084';
    var turquoise = '#71dfe6';
    var bodyfontsize = 18;
    var titlefontsize = 20;
    var errors = 'Please enter a number in:\n';
    
    var a1 = $('#a1').val();
    if( $.isNumeric(a1) ) {
        var b1 = a1*12;
        var c1 = b1*1.33;
    } else {
        errors += '(a)\n';
    }


    var f1 = $('#f1').val();
    if( $.isNumeric(f1) ) {
        $('#f2').val(f1);
        var g1 = c1-f1;
        $('#g1').val(g1);
    } else {
        errors += '(f)\n';
    }

    var h = $('input[name="h"]').val();
    var i = $('input[name="i"]').val();
    var j = $('input[name="j"]').val();

    if( !$.isNumeric(h) ) { errors += '(h)\n'; }
    if( !$.isNumeric(i) ) { errors += '(i)\n'; }
    if( !$.isNumeric(j) ) { errors += '(j)\n'; }

    var k = 0;
    var r = 0;
    if( $.isNumeric(h) &&  $.isNumeric(i) && $.isNumeric(j)) {
        k = (+h) + (+i) + (+j);

        r = $('#option').val();
        if( $.isNumeric(r) ) {
            l = ((r*k)/100)/12;
            l=l.toFixed(2);
        }
    }
    
    var docDefinition = {
        pageMargins: [ 0, 0, 0, 0 ],
        content: [
            {
                image: frontpageimage,
                width: 500,
                pageBreak: 'after',
                margin: [-50, 0, 0, 0]
            },
            
            {
                table: {
                    widths: [ '500' ],
                    body: [
                            [{text: 'This Quick Start Formula is a supplement to:', fontSize: bodyfontsize, color: 'white', fillColor: bodytextcolor}],
                            [{text: 'How Much Will You Need to Retire?', italics: true, fontSize: titlefontsize, color: bodytextcolor, fillColor: turquoise}],
                            [{text: 'The Frustrated Doctor\'s Guide to Creating Lifestyle Freedom Faster Than You Ever Thought Possible', italics: true, fontSize: bodyfontsize, color: bodytextcolor, fillColor: turquoise}]
                    ]
                }, 
                layout: 'noBorders'
            }, 
            
            {
                text: [
                    {text: '\n\nQuick Start Formula\n', fontSize: titlefontsize, color: bodytextcolor},
                    {text: 'Begin with the end in mind… and reverse engineer\n\n', style: 'bodytext'}
                ]
            },
            
            {
                image: divider,
                width: 500,
                height: 1
            },
            
            {
                text: [
                    {text: '\nI. Income Replacement\n (replacing your labor-produced income):\n\n', style: 'subheader'},
                    {text: 'How much income do you need to replace for your desired lifestyle post-practice? Assume that current debt obligations and any known future major obligations have been provided for (tip: don’t retire until these have been handled).', style: 'bodytext'}
                ]
            },
            
            {
                table: {
                    widths: [ '500' ],
                    body: [
                            [{ text: ['(a)',{ text: '$' + a1, bold: true },'(monthly lifestyle income required) ', { text: 'X 12 ', bold: true }, ' months ='] }],
                            [{ text: ['(b)',{ text: '$' + b1, bold: true },'(annual income required)']}],
                            [{ text: 'Gross up for taxes (est. 25% effective rate):'}],
                            [{ text: ['(b)',{ text: '$' + b1 + ' X 1.33', bold: true },' = (c)', { text: '$' + c1, bold: true }, '(total annual income req.)']}]
                    ]
                }, 
                layout: 'noBorders',
                style: 'table'
            },
            
            {
                text: [
                    {text: 'Inflation', bold: true}, 
                    '(best guestimate) = ', 
                    {text: '4%', bold: true}, 
                    ' per year \n(We\'ll deal with inflation in the asset investment section) ',
                    {text: '\n\nII. Current Passive Cash Flow (investment returns)\n\n', style: 'subheader'},
                    'What is your current passive cash flow income from investment capital/assets? (stocks, bonds, annuities, real estate)'
                ],
                style: 'bodytext'
            },
            
            {
                table: {
                    widths: [ '500' ],
                    body: [
                            [{ text: ['(f)', { text: '$' + f1, bold: true }, '(annual passive cash flow).']}],
                            [{ text: ['(c)', { text: '$' + c1, bold: true }, 'minus (f)', { text: '$' + f1, bold: true }, '=']}],
                            [{ text: ['(g)', { text: '$' + g1, bold: true }, '(your current “income gap”)*']}]
                    ]
                }, 
                layout: 'noBorders',
                style: 'table'
            },
            
            {
                text: [
                    '*Note: Depending on “your number ‘g’,” you have two choices in order to retire or transition out sooner:', 
                    {text: '\n1. Reduce your retirement lifestyle expectation (and/or)\n2. Increase your investment capital and return expectations', bold: true},
                    {text: '\n\nIII. Available Capital Investment\n\n', style: 'subheader'},
                    'What is your best estimate of the proceeds from the sale of your business or professional practice',
                    {text: 'after ', decoration: 'underline'},
                    {text: 'tax? ', decoration: 'underline'},
                    '= (h)', 
                    { text: '$' + h1, bold: true },
                    '\n\nEstimate the dollar amount of your current investment capital that is “under-invested” because of fear or indecision about the economy? For example, is a significant (20% or more) of your current investment capital invested in savings, CD’s or US T-bills? = (i)',
                    { text: '$' + i1, bold: true },
                    'Any other anticipated capital from asset sale or inheritance? = (j)',
                    { text: '$' + j1, bold: true }
                ],
                style: 'bodytext'
            },
            
            {
                table: {
                    widths: [ '500' ],
                    body: [
                            [{text: ['(h)', { text: '$' + h1, bold: true }, ' + (i)', { text: '$' + i1, bold: true }, ' + (j)', { text: '$' + j1, bold: true }, ' =']}],
                            [{text: ['(k)', { text: '$' + k1, bold: true }, '(net available capital for investment)']}]
                    ]
                }, 
                layout: 'noBorders',
                style: 'table'
            },
            
            {
                text: [
                    {text: 'IV. Return on Investment:*\n\n', style: 'subheader'},
                    'What can you expect as your average annual before tax return on investment (based on your investment acumen, risk tolerance and past history)?'
                ],
                style: 'bodytext'
            },
            
            {
                table: {
                    widths: [ 'auto', '*' ],
                    body: [
                            [{text: '1%', bold: true}, {text: 'CD’s, bank savings, U.S. T-Bills'}],
                            [{text: '2%', bold: true}, {text: 'Same as above'}],
                            [{text: '4%', bold: true}, {text: 'Municipal bonds (tax-preferred increases rate of return by approximately 25%)'}],
                            [{text: '8%', bold: true}, {text: 'secured, low risk, low volatility real estate investments'}],
                            [{text: '10%', bold: true}, {text: 'secured, low risk, low volatility real estate investments'}],
                            [{text: ['(r)__________', {text: '%', bold: true}, '(put your best guess number here). (K) _______________'], colSpan: 2}],
                    ]
                }, 
                layout: 'noBorders',
                style: 'table'
            },
            
            {
                text: [
                    '*Note: return on capital investment is the quandary of every investor and of every retiree. Safety and principal preservation must by high on the list of priorities, however current conservative returns (CD’s, savings, US T Bills) are historically low today. The final variables that have a huge impact on the future lifestyle of the retiree are ',
                    {text: '1) taxes', bold: true},
                    'and ',
                    {text: '2) inflation', bold: true},
                    '(the “hidden tax”).\n\n',
                    {text: 'V. Hypothetical Example:\n\n', style: 'subheader'},
                    'For the purpose of comparison, in this example, you determine that your desired post-retirement lifestyle would be well served with ',
                    {text: '$10,000/month X 12 months = $120,000/year.\n\n', bold: true},
                    'Remember: This number does not include consumer debt (personal residence, auto, vacation home, personal credit card or other personal debt). This debt needs to be paid off before your retirement date.*\n\n*Tip: paying off existing debt and building net worth and passive cash flow can be done simultaneously with the right plan of action and investment strategy. Most businessmen and professional practice owners have never had a viable plan or strategy and have relied on outmoded financial advisor plans that concentrate investments in stocks, bonds and annuities - all financial products are highly susceptible to volatility in the market place.\n\n',
                    {text: '$120,000 X 1.25 ', bold: true},
                    '(to gross up for taxes) ',
                    {text: '= $150,000/yr.', bold: true},
                    '(income requirement for post-retirement lifestyle)\n\n What’s Your Rate of Return? (on your available investment capital)? See your answer (r) above.'
                ],
                style: 'bodytext'
            },
            
            {
                table: {
                    widths: [ '500' ],
                    body: [
                            [{text: 'Reverse engineer', bold: true}],
                            [{text: '$150,000/yr. passive income requires:'}],
                            [{text: '@ 1% return............$15.0M capital investment required'}],
                            [{text: '@ 2% return............$7.50M capital investment required'}],
                            [{text: '@ 4% return............$3.75M capital investment required'}],
                            [{text: '@ 8% return............$1.875M capital investment required'}],
                            [{text: '@ 10% return...........$1.50M capital investment required'}]
                    ]
                }, 
                layout: 'noBorders',
                style: 'table'
            },
            
            {
                text: [
                    'The point is, your ability to safely earn a higher rate of return on investment is a major key to your ability to retire or slow down sooner without having to reduce your desired retirement lifestyle.\n\n',
                    {text: 'VI. How and Why Real Estate is Your Best Bet to Secure Your Retirement Lifestyle\n\n', style: 'subheader'},
                    'Real estate provides these I.D.E.A.L. benefits that no other investment asset class provides:\n\n',
                    {text: 'I', style: 'anagramStart'},
                    {text: 'ncome', style: 'anagramEnd'},
                    '(cash flow or interest)\n',
                    {text: 'D', style: 'anagramStart'},
                    {text: 'epreciation', style: 'anagramEnd'},
                    '(tax advantage)\n',
                    {text: 'E', style: 'anagramStart'},
                    {text: 'quity', style: 'anagramEnd'},
                    '(real estate can be purchased at a discount forced through property improvements, or realized via appreciation/inflastion, net worth build-up)\n',
                    {text: 'A', style: 'anagramStart'},
                    {text: 'mortization', style: 'anagramEnd'},
                    '(pay down of debt through rental income, equity build-up, net worth)\n',
                    {text: 'L', style: 'anagramStart'},
                    {text: 'everage', style: 'anagramEnd'},
                    '(real estate growth can be greatly enhanced through the use of safe and prudent leverage)\n\n',
                    {text: 'VII. The Inflation Factor\n\n', style: 'subheader'},
                    'Fixed income investments are highly susceptible to inflation (the hidden tax that destroys wealth not indexed) to inflation).'
                ],
                style: 'bodytext'
            },
            
            {
                table: {
                    widths: [ '500' ],
                    body: [
                            [{text: 'Secured real estate investments provide:', style: 'subheader'}],
                            [{text: '1. Hard asset investments (security)', fontSize: bodyfontsize}],
                            [{text: '2. Cash flow (dividends)', fontSize: bodyfontsize}],
                            [{text: '3. Inflation protection (growth)', fontSize: bodyfontsize}]
                        ]
                }, 
                layout: 'noBorders',
                fillColor: turquoise,
                color: bodytextcolor,
                margin: [0, 10, 0, 10]
            },
            
            {
                text: [
                    'Real estate cash flows (rents and/or interest payments) rise with inflation as does the intrinsic value of real estate.\n\n',
                    {text: 'VIII. Tax-Preferred Investments\n\n', style: 'subheader'}, 
                    'Taxes must be a consideration in any investment and retirement planning. Tax rates will only go up in the future.\n\n',
                    {text: 'Real estate is a “tax-preferred” investment. ', bold: true},
                    'Expenses and depreciation write-offs are two of the tax advantages of real estate 1031 exchanges (exchanging profit or gain) from one real estate property to another without paying current taxes on that profit.\n\n',
                    {text: 'Self-directed IRA\'s and Qualified Retirement Accounts ', bold: true},
                    'Very few people understand that real estate is an allowable option for retirement accounts. There are many IRS-approved third party custodians who can assist with setting up self-directed accounts which allows the account holder to “direct” or make their own investment decisions.'
                ],
                style: 'bodytext'
            }
        ],
        styles: {
            table: {
                fillColor: '#c5f2ff',
                margin: [0, 20, 0, 20],
                fontSize: 15,
                color: bodytextcolor
            },
            bodytext: {
                color: bodytextcolor,
                fontSize: bodyfontsize
            },
            anagramStart: {
                color: bodytextcolor,
                bold: true,
                fontSize: bodyfontsize
            }, 
            anagramEnd: {
                color: '#1e949b',
                bold: true,
                fontSize: bodyfontsize
            }, 
            subheader: {
                color: bodytextcolor,
                bold: true,
                fontSize: bodyfontsize
            }
        }
    };
    
    if (errors == 'Please enter a number in:\n') {
        pdfMake.createPdf(docDefinition).download('retirement.pdf');
    } else {
        alert(errors);
    }
}

